package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class User(    @SerializedName("no_tlp")    val noTlp: String = "",    @SerializedName("roles")    val roles: String = "",    @SerializedName("created_at")    val createdAt: String = "",    @SerializedName("email_verified_at")    val emailVerifiedAt: String? = null,    @SerializedName("alamat")    val alamat: String = "",    @SerializedName("password")    val password: String = "",    @SerializedName("photoProfile")    val photoProfile: String? = null,    @SerializedName("updated_at")    val updatedAt: String = "",    @SerializedName("no_bpjs")    val noBpjs: String = "",    @SerializedName("name")    val name: String = "",    @SerializedName("id")    val id: Int = 0,    @SerializedName("jenis_kelamin")    val jenisKelamin: String? = null,    @SerializedName("email")    val email: String = "",)data class NewLogin(    @SerializedName("access_token")    val accessToken: String = "",    @SerializedName("code")    val code: Int = 0,    @SerializedName("message")    val message: String = "",    @SerializedName("token_type")    val tokenType: String = "",    @SerializedName("user")    val user: User,    @SerializedName("status")    val status: String = "",)